import React from "react";
import { View, Text, TouchableOpacity, StyleSheet } from "react-native";
import { AntDesign, FontAwesome, MaterialIcons } from "@expo/vector-icons"; // You can import icons from the vector icon libraries you prefer

const HomeScreen = () => {
  return (
    <View style={styles.container}>
      <View style={styles.content}>
        {/* Content for the home page */}
        <Text style={styles.title}>Welcome to our App</Text>
        {/* Additional content can go here */}
      </View>
      <View style={styles.buttonContainer}>
        <TouchableOpacity style={styles.button}>
          <AntDesign name="home" size={24} color="black" />
          <Text style={styles.buttonLabel}>Accueil</Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.button}
          onPress={() => navigation.navigate("Cars")}
        >
          <FontAwesome name="building" size={24} color="black" />
          <Text style={styles.buttonLabel}>Agences</Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.button}
          onPress={() => navigation.navigate("Cars")}
        >
          <MaterialIcons name="directions-car" size={24} color="black" />
          <Text style={styles.buttonLabel}>Voitures</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
  },
  content: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
  title: {
    fontSize: 20,
    fontWeight: "bold",
    marginBottom: 20,
  },
  buttonContainer: {
    flexDirection: "row",
    justifyContent: "space-around",
    alignItems: "center",
    paddingBottom: 20,
  },
  button: {
    alignItems: "center",
  },
  buttonLabel: {
    marginTop: 5,
    fontSize: 16,
  },
});

export default HomeScreen;
